import { Outlet } from "react-router-dom";
import Header from "./Header";

function AppLayout() {
  return (
    <div className="flex w-full flex-col items-center gap-[15px] bg-gray-100 ">
      {/* header section */}
      <Header className=" fixed  w-full top-0  flex items-center justify-center self-stretch border-b border-solid border-gray-400 bg-white-A700 p-2 shadow-xs" />
      <Outlet />
    </div>
  );
}
export default AppLayout;
